import React from "react"
import Card from "./Card"

const Cardlist = ({ movies }) => {
    const cardArray = this.state.movies.map((movies, i) => {
        return <Card key={i} id={movies[i].id} title={movies[i].title} image={movies[i].poster_path} />
    })
    return (
        <div>
            {cardArray}
        </div>
    )
}
export default Cardlist
